*{
    margin: 0;
    padding: 0;
    box-sizing: border-box;

    &:after,&:before{
        box-sizing: border-box;
    }
}

html,body{
    overflow-x: hidden;
}

body{
    font-family: 'Poppins', sans-serif;
    line-height: 1.5;
    -webkik-font-smoothing:antialiased;
}

button,select,input,textarea{
    font: inherit;
}

a{
    text-decoration: none;
    color: inherit;
}

ul{
    list-style: none;
}

// select all p ann h
p,h1,h2,h3,h4,h5,h6{
    // pour que le contenu depasse jamais son parent
    overflow-wrap: break-word;
}

img,video,canvas,svg{
    max-width: 100%;
}

